import React from 'react'
import { Header, Menu, Image } from 'semantic-ui-react'


function App() {
  return (
    <div className="AppDiv">
      <Menu color={'black'} inverted>
        <Menu.Item active={true}> 
          <Image src='/static/cover_ver2.png' size = 'small'/>
        </Menu.Item>
        <Menu.Item
          name='Home'
          active={true}
        />
        <Menu.Item
          name='Menu 1'
          active={false}
        />
        <Menu.Item
          name='Menu 2'
          active={false}
        />
        <Menu.Item
          name='Menu 3'
          active={false}
        />
        <Menu.Item
          name='Menu 4'
          active={false}
        />
      </Menu>
    </div>
  );
};

export default App;
